DROP TABLE IF EXISTS `region`;
CREATE TABLE `region` (
  `code` int(11) NOT NULL DEFAULT '0' COMMENT '行政区编码',
  `parent_code` int(11) NOT NULL DEFAULT '0' COMMENT '直接上级行政区编码',
  `standard_name` varchar(255) DEFAULT '' COMMENT 'standardName',
  `name` varchar(255) DEFAULT '' COMMENT '行政区名称',
  `pinyin_shorthand_name` varchar(255) DEFAULT '' COMMENT '行政区名称拼音缩写',
  `pinyin_name` varchar(255) DEFAULT '' COMMENT '行政区名称拼音',
  `shorthand` varchar(10) DEFAULT '' COMMENT '行政区简称',
  `alias` varchar(255) DEFAULT '' COMMENT '行政区别名',
  `level` varchar(255) NOT NULL DEFAULT '' COMMENT '行政区级别（1：省,2：市,3：县,4：城镇）',
  `capital` bit(1) DEFAULT b'0' COMMENT '是否为首都、省会城市、市中心',
  `area_code` varchar(255) DEFAULT '' COMMENT '行政区电话区号',
  `zip_code` varchar(255) DEFAULT '' COMMENT '行政区邮政编码',
  `plate_number_prefix` varchar(255) DEFAULT '' COMMENT '车牌号前缀',
  `natural_geo_area` varchar(255) DEFAULT '' COMMENT '中国自然地理区，七大自然地理分区(华东、华北、华中、华南、西南、西北、东北)',
  `latitude` varchar(255) DEFAULT '' COMMENT '行政区中心经度',
  `longitude` varchar(255) DEFAULT NULL COMMENT '行政区中心纬度',
  `geo_hash` varchar(255) DEFAULT NULL COMMENT '行政区中心经纬度HASH',
  PRIMARY KEY (`code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='行政区域地区';

